import React from 'react'
import {Link} from 'react-router-dom'

import NavItem from './NavItem'
import {MdPeopleOutline, MdChatBubbleOutline, MdLocationOn, MdGroup, MdMailOutline, MdWork} from 'react-icons/md'
import styles from './NavList.module.css'

export default function NavList() {
    const items = [
        {text: 'People', icon: <MdPeopleOutline className={styles.icon} />, path: '/'},
        {text: 'Posts', icon: <MdChatBubbleOutline className={styles.icon} />, path: '/'},
        {text: 'Location', icon: <MdLocationOn className={styles.icon} />, path: '/'},
        {text: 'Groups', icon: <MdGroup className={styles.icon} />, path: '/'},
        {text: 'Inbox', icon: <MdMailOutline className={styles.icon} />, path: '/dog'},
        {text: 'Code', icon: <MdWork className={styles.icon} />, path: '/project'}
    ]

    return (
        <div className={styles.nav_list}>
        {items.map((e)=>(
             <Link to={e.path} >
                 <NavItem text={e.text} >
                         {e.icon}
                 </NavItem>
             </Link>
         ))}
        </div>
        // <div className={styles.nav_list}>
        //     <NavItem text='People'> <MdPeopleOutline className={styles.icon} /> </NavItem>
        //     <NavItem text='Posts'> <MdChatBubbleOutline className={styles.icon} /> </NavItem>
        //     <NavItem text='Location'> <MdLocationOn className={styles.icon} /> </NavItem>
        //     <NavItem text='Groups'> <MdGroup className={styles.icon} /> </NavItem>
        //     <NavItem text='Inbox'> <MdMailOutline className={styles.icon} /> </NavItem>
        //     <NavItem text='Code'> <MdWork className={styles.icon} /> </NavItem>
        // </div>
    )
}
